description:
Book of Eli, The (2010)

Verenigde Staten
Drama / Actie
118 minuten

geregisseerd door Albert Hughes en Allen Hughes
met Denzel Washington, Gary Oldman en Mila Kunis

Het verhaal over een man die in het post-apocalyptische Westen, alleen 
door Amerika trekt. Dit om een boek te beschermen dat geheimen bevat 
over het redden van de mensheid.

